"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?42/32/43529?source=see_link\">",
"      Clinical features, evaluation, and diagnosis of croup",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?9/61/10201?source=see_link\">",
"      Emergent evaluation of acute upper airway obstruction in children",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?43/29/44505?source=see_link\">",
"      Etiology and management of hoarseness in children",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?35/60/36808?source=see_link\">",
"      Parainfluenza viruses in children",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?31/11/31928?source=see_link\">",
"      Pharmacologic and supportive interventions for croup",
"     </a>",
"     <br/>",
"     <br/>",
"     The following organizations also provide reliable health information.",
"    </p>",
"    <p>",
"     <ul class=\"bullet-block\">",
"      <li>",
"       National Library of Medicine",
"      </li>",
"     </ul>",
