var title_f2_28_2508="Mgmt opioid constipation";
var content_f2_28_2508=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F60646&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F60646&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Common strategies for managing opioid-induced constipation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        1. Non-pharmacologic approaches for all patients, unless contraindicated by medical status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Increase fluid intake",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Increase dietary soluble fiber (avoid if severely debilitated or bowel obstruction is suspected)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Encourage mobility",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ensure comfort and privacy for defecation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        2. Select a pharmacologic strategy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intermittent use of a rectal therapy, either a suppository or enema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intermittent use (every 2-3 days) of an osmotic laxative, such as magnesium hydroxide, magnesium citrate, or sodium phosphate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Trial of a daily softening agent (sodium docusate)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intermittent use (every 2-3 days) of a contact cathartic, such as senna or bisacodyl",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Daily use of a contact cathartic (with or without a concurrent softening agent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Daily use of lactulose (unless lactose-intolerant) or sorbitol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Daily use of polyethylene glycol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        3. Adjust dose and dosing schedule of selected therapy to optimize effects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        4. Switch or combine conventional approaches if initial therapy is inadequate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        5. Consider methylnaltexone or trial of an alternative oral agent",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
